export const getWalletFunds = state => state.wallet.funds;
export const getBarExample = state => state.bar.example;
export const getBarAnotherExample = state => state.bar.anotherExample;
export const getFooExample = state => state.foo.example;
export const getFooAnotherExample = state => state.foo.anotherExample;
